import axios from 'axios';

export default class DocumentList extends React.Component {

    state = {
        documents: []
    }

	componentDidMount() {
		// const url = 'https://dev1.chili-publish.com/CHILI/rest-api/v1/resources/Documents/treelevel?parentFolder=templates&numLevels=1';
		const headers = {
  			headers: {
  				'Access-Control-Allow-Origin': '*',
    			'API-KEY': 'testKey1234='
  			}
		};

		// send a get request
		axios.get('/api/command', headers)
			.then(res => {
				// const documents = res.data;
				console.log(res.data);
			})
			.catch(() => console.log("some shit happened"))

	}

  	render() {
    	return <h1>whatever</h1>;
  	}
}
